import React from 'react';

function MessageDetail({ message }) {
  if (!message) {
    return <div>메시지를 선택하세요.</div>;
  }

  return (
    <div>
      <h2>메시지 상세 정보</h2>
      <div>
        <strong>보낸 사람:</strong> {message.sender_no}
      </div>
      <div>
        <strong>내용:</strong> {message.message_content}
      </div>
      <div>
        <strong>보낸 날짜:</strong> {message.send_date}
      </div>
    </div>
  );
}

export default MessageDetail;
